import { makeStyles } from '@material-ui/core'
import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { ListRestaurants } from '../actions/RestaurantActions'
import rs_bg from '../allImages/rs_bg.png'
function RestaurantsListScreen() {


    const restaurantList = useSelector(state => state.restaurantList)
    const { restaurants } = restaurantList
    const restList = [
        {
            name:'aliagar',
            location:'sagwara,sagwara,sagwara,sagwara,sagwara',
            
        }
    ]
    const dispatch = useDispatch()

    React.useEffect(() => {
        dispatch(ListRestaurants())
    }, [dispatch])

    const useStyles = makeStyles(theme => ({
        image: {
            position: 'absolute',
            width: '100%',
            height: '101%',
            zIndex: '-100',
            [theme.breakpoints.down('sm')]: {
                position: 'fixed'
            }
        },
        title: {
            position:'relative',
            ...theme.typography.content,
            textAlign: 'center',
            fontSize:'3rem',
            top:'30px',
            color:'black'
        
        }
    }))

    const classes = useStyles()

    return (
        <div>
            <img src={rs_bg} alt='bg-green' className={classes.image} ></img>
            <h1 className={classes.title} >ALL RESTAURANTS LIST</h1>
            {restaurants?.map(item => (
                <h1>{item.name}</h1>
            ))}
        </div>
    )
}

export default RestaurantsListScreen
